window.bookSummaryJSON = "<p><b>This star system is burning down.</b></p> <p>Seaman Jake Price's \"betters\" have failed the people of the Steele System, so he's taking matters into his own hands.</p> <p>Darkstream has tricked the public into believing the Quatro are the enemy, but the company has already sold the system's security to the <i>true</i> enemy: the Progenitors.</p> <p>Now, Jake is calling on everyone who remembers what it means to fight out of duty instead of money. If they can't stop Darkstream in time, the system <i>will</i> burn, and the inferno will consume everyone in it.</p> <p>Get <i>Infliction</i> and experience the epic finale of this military thrill ride today.</p>"; 
